INSERT INTO `#__volunteers_departments` (`id`, `parent_id`, `title`, `alias`, `description`, `website`, `email`, `notes`, `state`, `ordering`, `version`, `created_by`, `created`, `modified_by`, `modified`, `checked_out`, `checked_out_time`) VALUES
	(3, 0, 'Community Leadership Team', 'community-leadership-team-old', 'Provide the structures and community management necessary to create an online community that is enjoyable and rewarding to participate in, nurture and support online communities of users, provide support and information to users, and facilitate communication between users and the Production Working Group.', '', 'clt@community.joomla.org', '', 0, 1, 3, 430, '2016-05-22 15:45:04', 430, '2021-04-30 19:11:25', 0, '0000-00-00 00:00:00'),
	(41, 0, 'Production Leadership Team', 'production-leadership-team-old', 'Create software that is free, secure and of high-quality-encompasses everything that goes into the final product, not just code but also documentation, internationalization and localization efforts of all types.', 'https://developer.joomla.org/', '', '', 0, 2, 9, 430, '2016-05-22 15:45:15', 430, '2021-04-30 19:11:19', 0, '0000-00-00 00:00:00'),
	(42, 0, 'Open Source Matters', 'open-source-matters-old', 'Open Source Matters, Inc. (OSM) is a not-for-profit formed under United States and New York state law that provides organizational, legal, and financial support for the Joomla! open-source project. OSM has been incorporated as a New York not-for-profit to ensure the Joomla project and future projects continue to exist beyond the participation of individual volunteers.', '', '', '', 0, 3, 2, 430, '2016-05-22 15:45:21', 430, '2021-04-30 19:11:13', 0, '0000-00-00 00:00:00'),
	(50, 0, 'None', 'none', '', '', '', '', 0, 4, 1, 430, '2016-05-22 21:43:55', 430, '2016-08-15 22:38:16', 0, '0000-00-00 00:00:00'),
	(51, 58, 'Production', 'production', 'This department oversees all aspects related to the code of all software lead by the organization.', 'https://developer.joomla.org', 'production-dc@opensourcematters.org', '', 1, 5, 6, 430, '2016-05-22 21:43:59', 597, '2020-04-01 08:11:06', 0, '0000-00-00 00:00:00'),
	(52, 58, 'Legal & Finance', 'legal-financial', 'This department oversees the management of all accounting processes, including budget, bookkeeping and all legal matters related to the organization.', '', 'legal-finance-dc@opensourcematters.org', '', 0, 6, 4, 430, '2016-05-22 21:44:03', 2198, '2020-09-22 13:43:34', 0, '0000-00-00 00:00:00'),
	(53, 58, 'Marketing & Communication', 'marketing-communication', 'This department handles all matters related to marketing, PR, and communications needed to share information both internally and externally for the organization.', '', 'marketing-dc@opensourcematters.org', '#2022/007 - Form the Outreach Department as per the changes to the Bylaws approved by the members of the Corporation on December 12, 2021.', 0, 7, 11, 430, '2016-05-22 21:44:06', 2198, '2022-02-17 22:40:26', 0, '0000-00-00 00:00:00'),
	(54, 58, 'Events', 'events', 'This department manages the various events both related to code as well as community for the organization.', 'https://community.joomla.org/events.html', 'events-dc@opensourcematters.org', '', 0, 8, 6, 430, '2016-05-22 21:44:10', 2198, '2020-09-22 13:45:33', 0, '0000-00-00 00:00:00'),
	(55, 58, 'Operations', 'operations', 'This department focuses on the various areas required to support the organization\'s infrastructure, volunteers, and community.', '', 'operations-dc@opensourcematters.org', '', 1, 9, 3, 430, '2016-05-22 21:44:13', 2198, '2020-09-22 13:44:58', 0, '0000-00-00 00:00:00'),
	(56, 58, 'Programs', 'programs', 'This department\'s primary objective is to assist and facilitate the efforts of the various programs established for the community.\r\n\r\nThe teams have been merged into the Outreach Department\r\nhttps://volunteers.joomla.org/departments/outreach', '', '', '', 0, 10, 5, 430, '2016-05-22 21:44:16', 2198, '2022-02-17 23:28:11', 0, '0000-00-00 00:00:00'),
	(57, 58, 'Local Communities', 'local-communities-old', '', '', '', '', 0, 11, 2, 430, '2016-05-22 21:44:19', 430, '2021-04-30 19:11:04', 0, '0000-00-00 00:00:00'),
	(58, 0, 'Board of Directors', 'board-of-directors', 'The Board of Directors is comprised of 3 Department Coordination Team Leaders + 4 Officers required by law. The Officer roles are the president, vice president, secretary, and treasurer. \r\n\r\nThe task of the Board of Directors is to provide organisational, legal and financial support for the Joomla! Project.\r\n\r\nRole descriptions for each board member, as written by the current board can be found here:-\r\n', 'https://www.opensourcematters.org/organisation/directors/board-member-roles.html', 'secretary@opensourcematters.org', '', 1, 12, 10, 430, '2017-03-19 21:07:42', 465, '2022-04-20 14:49:18', 0, '0000-00-00 00:00:00'),
	(59, 58, 'Outreach', 'outreach', 'This department handles all matters related to marketing, PR, and communications needed to share information both internally and externally for the organization.', '', 'outreach-dc@opensourcematters.org', '#2022/007 - Form the Outreach Department as per the changes to the Bylaws approved by the members of the Corporation on December 12, 2021.', 1, 13, 2, 2198, '2022-02-17 22:40:33', 2198, '2022-02-17 22:42:54', 0, '0000-00-00 00:00:00');
