   (389, 0, 112, 'Onboarding', 'onboarding', 'Once people are interested in joining Joomla, the important part begins. The role of the onboarding member is to bring the volunteer in contact with possible mentors and the teams the person is interested in and serve them as a guide in the large community of Joomla.', 1, NULL, 1, 199, 1, 1041, '2017-05-12 10:28:01', 0, '2017-05-12 10:28:01', 0, '0000-00-00 00:00:00'),
   (391, 0, 86, 'Social Media Assistant', 'social-media-assistant', '', 0, NULL, 1, 201, 1, 1035, '2017-05-20 16:54:15', 0, '2017-05-20 16:54:15', 0, '0000-00-00 00:00:00'),
   (394, 0, 7, 'Copywriter', 'copywriter', 'Joomla is looking for a copywriter to work on the upcoming release portal and marketing messages for Joomla. Copywriters will be in charge of providing the text content of the landing page, pre and post-release campaigns on Social Media, release announcements, newsletters. \r\n\r\nWe need creative writers that will be in charge of texts that will be featured in release posts and landing pages. Coming up with copy that engages new Joomla users as well as experienced ones. These texts need to address our target audience which is small to large corporations that want a robust and versatile website.\r\n\r\nThe copywriter will need to create original work and develop ideas around the chosen theme(s); mainly to promote Joomla to our chosen audience(s) and communicate releases and release features.\r\n\r\nJoomla is looking to engage a larger audience of website designers and businesses that are looking for a robust and versatile CMS for their website. For this, we need copywriters to know how to write persuasively to promote Joomla as the number one choice, and in some cases, defend their creative choices to put this message across.\r\n\r\nJoomla needs a Copywriter who knows about Joomla as well as the Joomla target market, so that their copy is relevant and modern, and understand how people will react to their writing.\r\n\r\nSome texts are prepared by community members and volunteers, the copywriter will sometimes need to step in so that the copy proposed is edited to have proper tone, feeling, sentence structure and emotion but most importantly that the message sticks to the Joomla marketing strategy.', 1, NULL, 1, 202, 2, 462, '2017-06-05 14:56:50', 6731, '2020-09-07 18:26:46', 0, '0000-00-00 00:00:00'),
   (396, 0, 11, 'Designer', 'designer', 'We are looking for a skilled web-designer who could create mockups for the website. ', 0, NULL, 1, 204, 2, 449, '2017-06-15 08:47:26', 449, '2020-05-14 10:07:10', 0, '0000-00-00 00:00:00'),
   (397, 0, 11, 'Policy and Documentation Manager ', 'legal-assistant', 'Someone with basic understanding of law who would be in charge of creating terms of service. ', 0, NULL, 1, 205, 3, 449, '2017-06-15 08:48:10', 449, '2017-06-15 09:03:25', 0, '0000-00-00 00:00:00'),
