   (758, 0, 78, 'Operations & Marketing Coordinator', 'operations-marketing-coordinator', 'Responsible for the Operations and Marketing activities on the Certification platform.\r\n\r\nAssist Exam Providers in organising exam sessions.\r\nManage the Exam Calendar.\r\nManage the ticketing system, answering tickets or assigning tickets to the appropriate person.\r\nMaintain the Certification website\r\nSend newsletters and mailings.\r\nSupport other teams regarding JCP matters. \r\nMarketing\r\n\r\nReach out to Exam Providers to promote the Certification Program. \r\nCreate awareness for the Program inside and outside the Joomla! Community\r\nManage the JCP Facebook page. \r\nLiaise with the Joomla Social Media Team. \r\nWrite news and promotional articles\r\nCreate graphics (banners, ads, badges, flyers, etc.).', 1, NULL, 1, 560, 4, 1093, '2021-05-03 18:24:32', 1093, '2021-05-31 19:41:14', 0, '0000-00-00 00:00:00'),
