   (785, 0, 10, 'Social Media volunteer(s)', 'social-media-volunteer-s', 'We need three volunteers who are willing to post daily on our different Social Media channels, announce releases and when possible help (point) people with questions.\r\nAre you experienced in this and willing to join our team? Perfect! Are you enthusiastic but have basic experience, that\'s okay too. From time to time posts on new subjects need to be written so having a proper skill in writing English is needed. You can write an e-mail to Philip to apply for this nice role!\r\nphilip.walton@community.joomla.org', 1, NULL, 1, 587, 1, 584, '2022-03-18 21:50:25', 0, '2022-03-18 21:50:25', 0, '0000-00-00 00:00:00'),
   (786, 0, 50, 'Liaison CMS Release Team', 'liaison-cms-release-team', '', 0, NULL, 1, 588, 1, 465, '2022-06-09 07:23:17', 0, '2022-06-09 07:23:17', 0, '0000-00-00 00:00:00'),
