   (790, 0, 50, 'Release Manager 4.3', 'release-manager-4-3', '', 0, NULL, 1, 592, 1, 465, '2022-08-10 20:38:56', 0, '2022-08-10 20:38:56', 0, '0000-00-00 00:00:00'),
   (791, 0, 179, 'Liaison', 'maintenance-liaison', 'Liaisons help us connect and communicate with other Joomla teams and Working Groups.', 0, NULL, 1, 593, 3, 446, '2022-08-17 11:01:55', 446, '2022-08-17 11:03:25', 0, '0000-00-00 00:00:00'),
   (792, 0, 179, 'UX Engineer', 'ux-engineer', 'Front end development with a focus on usability principles and bridging the gap between design and development. Basically, help translate recommendations from design or research into semantic code and help developers understand the why. A role good for people who like both sides of the coin, or front-end developers who want to dip their toes into the world of UX. ', 1, NULL, 1, 594, 1, 446, '2022-08-23 11:05:39', 0, '2022-08-23 11:05:39', 0, '0000-00-00 00:00:00'),
   (793, 0, 179, 'User Researcher', 'user-researcher', 'Hands-on talking to people, designing surveys and collecting data, as well as tracking relevant feedback from GitHub issues. From all of this, you can begin seeing what kind of patterns emerge. If you have the background, data analysis would be helpful in this role too, but it\'s not necessary. A good intuition for user needs helps in this role as well as a desire to back that intuition up with evidence when providing recommendations.', 1, NULL, 1, 595, 1, 446, '2022-08-23 11:08:24', 0, '2022-08-23 11:08:24', 0, '0000-00-00 00:00:00'),
   (794, 0, 179, 'Information Architect', 'information-architect', 'This role helps figure out how pages, content, menus, or processes are structured so that it is intuitive to navigate and complete tasks. For example, in this role you might be creating site maps, making sure menus are organized well, links and screens are clear and intuitive, and also may do a touch of content strategy when necessary to ensure we are providing complete and consistent information.\r\n', 1, NULL, 1, 596, 1, 446, '2022-08-23 11:11:25', 0, '2022-08-23 11:11:25', 0, '0000-00-00 00:00:00'),
   (795, 0, 179, 'DesignOps', 'designops', 'The operational side of UX, responsible for making sure team workflows make sense, there aren\'t bottlenecks, motivate people, and also helping to brainstorm the vision for the future and roadmaps. Also responsible for leading communication with other teams and talking about the recommendations/actions the rest of the team is making. \r\n\r\nBy necessity, whoever is voted as team lead / team assistant lead will be responsible for at least some of this. Strong communications skills will be important in this role.', 0, NULL, 1, 597, 1, 446, '2022-08-23 11:12:54', 0, '2022-08-23 11:12:54', 0, '0000-00-00 00:00:00'),
   (796, 0, 179, 'UI Designer', 'ui-designer', 'Straight up interface design, either for new elements or based on existing patterns. Critically, the designer must be centered on the user experience and have a strong focus on accessibility. Any mockups or designs should also include accessibility annotations, like indicating tab order, focus states, etc.', 1, NULL, 1, 598, 1, 446, '2022-08-23 11:14:50', 0, '2022-08-23 11:14:50', 0, '0000-00-00 00:00:00'),
   (797, 0, 179, 'UX Writer', 'ux-writer', 'The UX writer is a copywriter with a defined focus on content that is often overlooked, like button labels and error messages. This role is responsible for ensuring the phrasing throughout the interface is consistent, as well as reviewing system messages (errors) to make sure they\'re clear and actionable, and possibly also helping/being a liaison with the documentation team to ensure the content is consistent and clear.', 1, NULL, 1, 599, 1, 446, '2022-08-23 11:16:37', 0, '2022-08-23 11:16:37', 0, '0000-00-00 00:00:00'),
   (798, 0, 179, 'Back End Developer', 'back-end-developer', 'The JXT may have ideas and recommendations that are influenced by or affect how the back end code is architected. It would be nice to be able to communicate about that on the team instead of liaising back and forth for small issues or questions. This role will also help fix usability issues that extend beyond the front end interface, and advocate for the developer experience.', 1, NULL, 1, 600, 1, 446, '2022-08-23 11:18:08', 0, '2022-08-23 11:18:08', 0, '0000-00-00 00:00:00'),
   (799, 0, 179, 'UX Strategist', 'ux-strategist', 'This role helps the JXT brainstorm future opportunities for Joomla, and together with DesignOps, formulates these opportunities into a strategic roadmap that will take us from where we are to where we need to be. Close collaboration with the other roles in JXT is needed to ensure we are all going in the same direction. An ability to look at things from the bigger picture is helpful here, as well as the ability to balance that with the reality of volunteer-driven projects. Big ideas welcomed!', 0, NULL, 1, 601, 1, 446, '2022-08-23 12:18:15', 0, '2022-08-23 12:18:15', 0, '0000-00-00 00:00:00'),
   (800, 0, 44, 'Advisor', 'advisor', '', 0, NULL, 1, 602, 1, 695, '2022-11-04 20:24:03', 0, '2022-11-04 20:24:03', 0, '0000-00-00 00:00:00'),
